import React from 'react';
import { Card, Avatar } from 'antd';

const UserProfile = () => {
    return (
        <Card
            action
        >
             <Card.Meta
                 avatar={<Avatar>OY</Avatar>}
                 title="OH YEAH"
             />
        </Card>
    )
}

export default UserProfile;
